script: |
  super -f text -I q5750.spq | sort > q5750.out

inputs:
  - name: q5750.spq
    data: |
      SELECT CAST ( NULL AS REAL ) AS col1 FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + col0 + + + col2 + 12 * - - 56 NOT BETWEEN NULL AND NULL;
  - name: tab1

outputs:
  - name: q5750.out
    data: |
